CREATE PROCEDURE [DBO].ctemp AS
BEGIN
DECLARE @i int;
SET @i = 1;
while @i < 500 BEGIN
			 @i, 		 concat('name',convert(VARCHAR(10),@i) ),
			10+@i,		GETDATE(),
			concat('surname_',convert(VARCHAR(10),@i*2+100000)),
			GETDATE(),
			RAND()*1000,
			RAND()*10000 );
 SET @i = @i+1;
END
END


