-- CREAZIONE VISTA auditcheckview
IF EXISTS(select * from sysobjects where id = object_id(N'[DBO].[auditcheckview]') and OBJECTPROPERTY(id, N'IsView') = 1)
DROP VIEW [DBO].[auditcheckview]
GO

CREATE VIEW [DBO].auditcheckview
	(
	tablename,
	opkind,
	idcheck,
	idaudit,
	title,
	severity,
	sqlcmd,
	message,
	precheck,
	flag_comp,
	flag_cash,
	flag_both,
	flag_credit,
	flag_proceeds
	)
	AS SELECT
	auditcheck.tablename,
	auditcheck.opkind,
	auditcheck.idcheck,
	auditcheck.idaudit,
	audit.title,
	audit.severity,
	auditcheck.sqlcmd,
	auditcheck.message,
	auditcheck.precheck,
	auditcheck.flag_comp,
	auditcheck.flag_cash,
	auditcheck.flag_both,
	auditcheck.flag_credit,
	auditcheck.flag_proceeds
	FROM auditcheck (NOLOCK)
	JOIN audit (NOLOCK)
	ON audit.idaudit = auditcheck.idaudit
GO

--- SP per regola 'TEST001'
if exists (select * from dbo.sysobjects where id = object_id(N'[DBO].[check_customuser_u_post]') and OBJECTPROPERTY(id, N'IsProcedure') = 1)
drop procedure [DBO].[check_customuser_u_post]
GO

CREATE PROCEDURE [DBO].check_customuser_u_post
(
    @res SMALLINT OUT,
    @new_idcustomuser varchar(50) = ''
)
AS BEGIN
    SET NOCOUNT ON
    SET @res=0
    declare @v01 int
    SET @v01=0
    SELECT @v01 = count(idcustomuser) FROM customusergroup where idcustomuser=@new_idcustomuser

    -- idcheck: 1
    -- idaudit: CUSTOMUSER
    if not((@v01=0))SET @res=@res+0x1
END
GO


