CREATE PROCEDURE [DBO].[check_registryreference_u_post] @res SMALLINT OUT, @NEW_idregistryreference int=null, @NEW_idreg int=null, @NEW_flagdefault char(1)=null, @NEW_email varchar(200)=null, @NEW_userweb varchar(40)=null AS
BEGIN
 SET NOCOUNT ON
-- LAST MODIFIED: 09/01/2023  15:08
--
SET @res=0
declare @v01 int -- W16800 (2)
SET @v01 = 0
DECLARE  @f01 char(1)
SET  @f01 ='N'
declare @v02 int -- W28800
SET @v02 = 0
declare @v03 int -- W16000
SET @v03 = 0


-- idcheck: 1
-- idaudit: ANAGR008
-- Message: %<registry.title>% ha già un contatto predefinito
if ( @new_flagdefault<>'s')GOTO end_check_1
SELECT @v01 = count(*) FROM  registryreference where flagdefault='s'and idregistryreference<>@new_idregistryreference and idreg=@new_idreg
SET  @f01 ='S'
if not(@v01=0 )SET @res=@res +0x1
end_check_1:



-- idcheck: 2
