if ( isnull(@new_email,'')='')GOTO end_check_3
if ( isnull(@new_flagdefault,'')<>'s')GOTO end_check_3
SELECT @v02 = count(*) FROM  registryreference rr join registry r on rr.idreg=r.idreg where rr.email=@new_email and rr.idreg<>@new_idreg and rr.flagdefault='s'and r.active='s'
if not(@v02=0 )SET @res=@res +0x4
end_check_3:



-- idcheck: 1
-- idaudit: SICUR008
-- Message: Non è possibile attribuire a due fornitori la stessa login web
if ( isnull(@new_userweb,'')='')GOTO end_check_4
SELECT @v03 = count(*) FROM  registryreference where userweb=@new_userweb
if not(@v03=1 )SET @res=@res +0x8
end_check_4:

END

